import './App.css';

function App() {
  return (
    <div className="App">
      <div>MY TODO LIST</div>
      <div className="create-div">
        <label for="titleIpt">TASK</label><input id="titleIpt" type="text"></input>
        <label for="badyIpt">TASK CONTENT</label><input id="bodyIpt" type="text"></input>
        <button>add</button>
      </div>
      <div className="select-div">
        <div>Working</div>
        <div>Done</div>
      </div>
    </div>
  );
}

export default App;
